import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
  NavBtnLink
} from './NavBarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
        {/* <NavLink to='/'> */}
          {/* <img src={require('../../images/logo.svg')} alt='logo' /> */}
        {/* </NavLink> */}
        {/* <Bars /> */}
        <NavMenu>
          <NavLink to='/Suppliers' activeStyle>
            About
          </NavLink>
          <NavLink to='/Customers' activeStyle>
            Services
          </NavLink>
          <NavLink to='/Items' activeStyle>
            Contact Us
          </NavLink>
          <NavLink to='/Stocks' activeStyle>
            Sign Up
          </NavLink>
          <NavLink to='/Stocks' activeStyle>
            Sign Up
          </NavLink>
          {/* Second Nav */}
          {/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
        </NavMenu>

      </Nav>
    </>
  );
};

export default Navbar;
